import { faUser } from "@fortawesome/free-solid-svg-icons";

library.add(faUser);
// import "../../../css/node.css"


export const AdditionalDestinationNode = ({
    className,
    onClick,
    ...props
}) => (
        <BaseNode className={"node node-additional-destestination " + className} onClick={onClick}{...props}>
